import React from "react";
import ViewPicture from "./ViewPicture";

class Memories extends React.Component {
  refCallback = (element) => {
    if (element) {
      var x = this.props.getSize(element.getBoundingClientRect());
      console.log(x);
    }
  };
  render() {
    return (
      <>
        <div
          ref={this.refCallback}
          id="root1"
          className="root1"
          style={{
            height: "95%",
            width: "95%",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            fontFamily: "Dancing",
            borderRadius: "25px",
            boxShadow: "3px 6px 10px 10px #585858",
          }}
        >
          <ViewPicture />
        </div>
      </>
    );
  }
}
export default Memories;
